import React, { useState } from "react";
import { MercadoStyle } from './styles'
import SideBar from "../../Components/SideBar";
import CardJogador from "../../Components/CardJogador";
import SearchBar from "../../Components/ SearchBar";
import ModalConfirmacao from "../../Components/ModalConfirmacao";

function Mercado() {
    const [compra, setCompra] = useState('naoComprar');
    const [isModalVisible, setModalIsVisible] = useState<boolean>(false);


    return (
        <>
            <MercadoStyle>

                <div className="container">
                    <SideBar selected="mercado" />
                    <SearchBar />
                    <CardJogador setCompra={setCompra}/>

                    {compra == 'comprar' ? <ModalConfirmacao children={<h1>Gostaria de comprar este jogador?</h1>}/> : null}  
                </div>

            </MercadoStyle>
        </>
    );
}

export default Mercado;
